@SenBlumenthal The one who needs to grow an spine is you.
What used to be a human Dem. Senator, has turned now , because of political TDS, in a worm.
Please, try to see if you can recover your manhood.

@SenBlumenthal Dear Senator 
Please, note that the IRGC is a designated terrorist organization. Any agreement that empowers it risks global security and betrays human rights. Iran needs accountability, not concessions.
The Iranian people need principled support for a democratic transition.
